import org.apache.commons.vfs2.impl.PrivilegedFileReplicator;
import org.apache.commons.vfs2.provider.local.DefaultLocalFileProvider;
import org.apache.commons.vfs2.provider.smb.SmbFileProvider;
import org.junit.jupiter.api.Test;

/**
 * Tests file resolution using a resource scheme within a VFS manager configured with SMB provider support.
 */
public class ResourceResolutionTest {

    /**
     * A provider configuration helper that simulates the test environment setup.
     */
    private static class ProviderConfig {

        public DefaultFileSystemManager getManager() {
            return new DefaultFileSystemManager();
        }

        public FilesCache getFilesCache() {
            return new DefaultFilesCache();
        }

        public TemporaryFileStore getTempFileStore() {
            return new DefaultTemporaryFileStore();
        }

        /**
         * Registers the SMB file provider with the given manager.
         *
         * @param manager The file system manager to configure.
         * @throws FileSystemException if an error occurs.
         */
        public void prepare(final DefaultFileSystemManager manager) throws FileSystemException {
            if (!manager.hasProvider("smb")) {
                manager.addProvider("smb", new SmbFileProvider());
            }
        }

        /**
         * Retrieves the base test folder, which is a VFS junction to a directory from a system property.
         *
         * @param manager The file system manager.
         * @return The base folder file object.
         * @throws FileSystemException if an error occurs.
         */
        public FileObject getBaseTestFolder(final DefaultFileSystemManager manager) throws FileSystemException {
            final String propertyName = "test.basedir.uri";
            String baseDirUri = System.getProperty(propertyName);
            if (baseDirUri == null) {
                // Default to a path relative to the module root
                baseDirUri = new File("src/test/resources").getAbsoluteFile().toURI().toString();
                System.setProperty(propertyName, baseDirUri);
            }
            return manager.resolveFile(baseDirUri);
        }
    }

    private static void assertEmpty(final File file) throws java.io.IOException {
        if (file.exists() && file.isDirectory()) {
            assertTrue(FileUtils.isEmptyDirectory(file), "Directory should be empty: " + file.getPath());
        }
    }

    /**
     * Validates that a "res:" URI can be resolved correctly even with other providers configured.
     *
     * @throws Exception if an error occurs during the test.
     */
    @Test
    public void testResourceResolution() throws Exception {
        final ProviderConfig providerConfig = new ProviderConfig();
        final File testDir = Files.createTempDirectory("smb-test-").toFile();
        FileUtils.cleanDirectory(testDir);

        final DefaultFileSystemManager manager = providerConfig.getManager();
        manager.setFilesCache(providerConfig.getFilesCache());
        manager.setReplicator(new PrivilegedFileReplicator(new DefaultFileReplicator(testDir)));
        manager.setTemporaryFileStore(providerConfig.getTempFileStore());

        providerConfig.prepare(manager);

        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }

        manager.init();

        FileObject baseFolder = null;
        FileObject readFolder = null;
        FileObject writeFolder = null;

        try {
            baseFolder = providerConfig.getBaseTestFolder(manager);
            readFolder = baseFolder.resolveFile("test-data");
            writeFolder = baseFolder.resolveFile("write-tests");

            assertTrue(readFolder.exists(), "Read folder should exist.");
            assertNotEquals("/", readFolder.getName().getPath(), "Read folder path should not be the root.");

            // Resolve the resource and assert its existence
            final FileObject resFile = manager.resolveFile("res:test-data/test.zip");
            assertTrue(resFile.exists(), "Resolved resource file should exist.");

        } finally {
            // Teardown sequence
            if (readFolder != null) {
                readFolder.close();
            }
            if (writeFolder != null) {
                writeFolder.close();
            }
            if (baseFolder != null) {
                baseFolder.close();
            }

            // Garbage collection cycles
            for (int i = 0; i < 5; i++) {
                System.gc();
                Thread.sleep(200);
            }

            if (manager != null) {
                manager.freeUnusedResources();
                manager.close();
            }

            // Pause for background threads
            Thread.sleep(1000);

            assertEmpty(testDir);
            FileUtils.deleteDirectory(testDir);

            VFS.close();
        }
    }
}

package org.apache.commons.vfs2;

import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertNotNull;
import static org.junit.jupiter.api.Assertions.assertTrue;

import java.io.File;
