/**
 * Tests that the path encoding system properly rejects invalid input scenarios.
 *
 * @see UriParser
 */
public class UriParserTest1 {

    /**
     * Tests that {@link UriParser#encode(String, java.nio.charset.Charset)} fails when presented with missing path
     * information or when no character encoding specification is provided.
     */
    @Test
    public void testEncodeRejectsInvalidInput() {
        // First, attempt to encode a path when the path information itself is absent.
        final NullPointerException e1 = assertThrows(NullPointerException.class,
            () -> UriParser.encode(null, StandardCharsets.UTF_8));
        assertEquals("uri", e1.getMessage());

        // Second, simulate providing path information but omitting the required character encoding specification.
        final NullPointerException e2 = assertThrows(NullPointerException.class,
            () -> UriParser.encode("/test-path", null));
        assertEquals("charset", e2.getMessage());
    }
}

