/**
 * Tests for the case-sensitive name file filter.
 */
public class NameFileFilterTest1 {

    private FileSelectInfo createFileSelectInfo(final String filename) throws FileSystemException {
        final FileSystemManager fsManager = VFS.getManager();
        final FileObject file = fsManager.resolveFile("ram:/" + filename);
        final DefaultFileSelectInfo info = new DefaultFileSelectInfo();
        info.setFile(file);
        info.setBaseFolder(file.getParent());
        return info;
    }

    @Test
    public void testNameFileFilterCaseSensitive() throws FileSystemException {
        final List<String> names = Arrays.asList("test.txt", "another.log");
        final NameFileFilter filter = new NameFileFilter(names, IOCase.SENSITIVE);

        assertFalse(filter.accept(createFileSelectInfo("TEST.TXT")));
