 */
public class NameFileFilterTest1 {

    @Test
    public void testCaseSensitiveFileNameFiltering() throws FileSystemException {
        final FileSystemManager fsManager = VFS.getManager();
        final FileObject baseFolder = fsManager.resolveFile("ram:///");

        // Rule: approved names are "approved-file.txt" and "data.log", case-sensitive.
        final NameFileFilter caseSensitiveFilter = new NameFileFilter(IOCase.SENSITIVE, "approved-file.txt", "data.log");

        // 1. Test rejection: matches an approved name but with different capitalization.
        final FileObject caseMismatchFile = fsManager.resolveFile(baseFolder, "Approved-File.txt");
        final FileSelectInfo caseMismatchInfo = new FileSelectInfo(baseFolder, caseMismatchFile, 0);
        assertFalse(caseSensitiveFilter.accept(caseMismatchInfo), "Should reject due to case mismatch.");

        // 2. Test acceptance: exactly matches the second approved name.
        final FileObject exactMatchFile = fsManager.resolveFile(baseFolder, "data.log");
        final FileSelectInfo exactMatchInfo = new FileSelectInfo(baseFolder, exactMatchFile, 0);
        assertTrue(caseSensitiveFilter.accept(exactMatchInfo), "Should accept exact case-sensitive match.");

        // 3. Test rejection: matches the second approved name but with mixed capitalization.
        final FileObject mixedCaseFile = fsManager.resolveFile(baseFolder, "Data.Log");
        final FileSelectInfo mixedCaseInfo = new FileSelectInfo(baseFolder, mixedCaseFile, 0);
        assertFalse(caseSensitiveFilter.accept(mixedCaseInfo), "Should reject mixed-case variant.");

        // 4. Test rejection: name is not in the approved list at all.
        final FileObject unlistedFile = fsManager.resolveFile(baseFolder, "unrelated.file");
        final FileSelectInfo unlistedInfo = new FileSelectInfo(baseFolder, unlistedFile, 0);
        assertFalse(caseSensitiveFilter.accept(unlistedInfo), "Should reject a name not on the approved list.");
    }
}

