import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;

/**
 * Tests for {@link NameFileFilter}.
 */
@ExtendWith(MockitoExtension.class)
public class NameFileFilterTest1 {

    @Mock
    private FileSelectInfo fileSelectInfo;

    @Mock
    private FileObject fileObject;

    @Mock
    private FileName fileName;

    @BeforeEach
    public void setUp() {
        when(fileSelectInfo.getFile()).thenReturn(fileObject);
        when(fileObject.getName()).thenReturn(fileName);
    }

    @Test
    public void testAcceptCaseInsensitive() {
        final String filterName = "test.txt";
        final NameFileFilter filter = new NameFileFilter(filterName, IOCase.INSENSITIVE);

        // Test that a completely different file name is rejected
        when(fileName.getBaseName()).thenReturn("another.file");
        assertFalse(filter.accept(fileSelectInfo), "Filter should reject a different file name.");

        // Test that an exact match is accepted
        when(fileName.getBaseName()).thenReturn("test.txt");
        assertTrue(filter.accept(fileSelectInfo), "Filter should accept an exact match.");

        // Test that a match with a capitalized first letter is accepted
        when(fileName.getBaseName()).thenReturn("Test.txt");
        assertTrue(filter.accept(fileSelectInfo), "Filter should accept a case-variant match (capitalized).");

        // Test that a match with different casing is accepted
        when(fileName.getBaseName()).thenReturn("TEST.TXT");
        assertTrue(filter.accept(fileSelectInfo), "Filter should accept a case-variant match (uppercase).");

        // Test that a different file name with a different extension is rejected
        when(fileName.getBaseName()).thenReturn("test.zip");
        assertFalse(filter.accept(fileSelectInfo), "Filter should reject a file with a different extension.");
    }
}

