        final Charset iso88591Charset = StandardCharsets.ISO_8859_1;
        configBuilder.setControlCharset(options, iso88591Charset);

        // Verify the system handles both input approaches and maintains consistency
        assertEquals(iso88591Charset.name(), configBuilder.getControlEncoding(options));
        assertEquals(iso88591Charset, configBuilder.getControlCharset(options));
    }
}

