package org.apache.commons.vfs2.impl;

import static org.junit.jupiter.api.Assertions.assertNotNull;

import java.io.InputStream;
import org.apache.commons.vfs2.FileObject;
import org.apache.commons.vfs2.FileSystemException;
import org.apache.commons.vfs2.cache.DefaultFilesCache;
import org.apache.commons.vfs2.provider.res.ResourceFileProvider;
import org.junit.jupiter.api.Test;

/**
 * Tests the system's capability to retrieve and access file content from a remote location using a specific protocol
 * handler.
 */
public class DefaultFileSystemManagerTest1 {

    /**
     * This test validates the file management system's ability to handle remote file access. It configures the file
     * manager with a cache and a resource protocol handler, then resolves a file from a remote path. The test
     * confirms that a data stream to the file's content is successfully opened. Finally, it ensures all resources
     * are properly released.
     *
     * @throws FileSystemException if a file system error occurs.
     */
    @Test
    public void testRemoteFileAccessValidation() throws FileSystemException {
        // Configure the file management system with a caching mechanism and a protocol handler.
        final DefaultFileSystemManager manager = new DefaultFileSystemManager();
        try {
            // Establish a caching mechanism to optimize repeated file access.
            manager.setFilesCache(new DefaultFilesCache());

            // Register the protocol handler to enable communication with remote resources.
            manager.addProvider("res", new ResourceFileProvider());

            // Initialize the system for operation.
            manager.init();

            // Locate a specific file stored at a known remote path.
            final FileObject remoteFile = manager.resolveFile("res:test.properties");

            // Verify the system successfully establishes a connection to the file's content.
            try (final InputStream dataStream = remoteFile.getContent().getInputStream()) {
                assertNotNull(dataStream, "A data stream should become available for reading.");
            } finally {
                // Release the file reference after access.
                remoteFile.close();
            }
        } finally {
            // Release all system resources to ensure proper cleanup.
            manager.close();
        }
    }
}

