        final FileSystemManager manager = VFS.getManager();
        if (manager instanceof DefaultFileSystemManager) {
            final DefaultFileSystemManager dfsm = (DefaultFileSystemManager) manager;
            File tempDir = null;
            try {
                final Field replicatorField = DefaultFileSystemManager.class.getDeclaredField("replicator");
                replicatorField.setAccessible(true);
                final Object replicator = replicatorField.get(dfsm);
                if (replicator != null) {
