package org.apache.commons.vfs2;

import static org.junit.jupiter.api.Assertions.assertThrows;

import java.io.OutputStream;
import org.apache.commons.vfs2.impl.DefaultFileSystemManager;
import org.junit.jupiter.api.Test;

/**
 * Tests copy operations to a read-only destination file.
 */
public class ReadOnlyFileTest {

    /**
     * Validates that the system correctly prevents unauthorized modifications to protected file resources when
     * attempting to copy data to a read-only destination.
     */
    @Test
    public void testCopyToReadOnlyFileFails() throws Exception {
        // The user request to check for a remote server is skipped as this test can be performed
        // on any file system provider, including the in-memory RAM provider.

        try (final DefaultFileSystemManager fsManager = new DefaultFileSystemManager()) {
            fsManager.init();

            // Establish a working area within the file system for safe test operations.
            final FileObject baseDir = fsManager.resolveFile("ram:///readOnlyCopyTest");

            try {
                baseDir.createFolder();

                // Create a source file to serve as the origin for the copy operation.
                final FileObject sourceFile = baseDir.resolveFile("source.txt");
                sourceFile.createFile();
                try (final OutputStream os = sourceFile.getContent().getOutputStream()) {
                    os.write("source content".getBytes());
                }

                // Create a destination file and mark it as read-only.
                final FileObject destFile = baseDir.resolveFile("destination.txt");
                destFile.createFile();
                destFile.setWritable(false, false);

                // Attempt to copy and verify that the operation is rejected.
                assertThrows(FileSystemException.class, () -> {
                    destFile.copyFrom(sourceFile, Selectors.SELECT_SELF);
                }, "Copying to a read-only file should fail with a FileSystemException.");

            } finally {
                // Ensure all created resources are cleaned up.
                if (baseDir.exists()) {
                    // Restore write permissions to allow cleanup.
                    final FileObject destFile = baseDir.resolveFile("destination.txt");
                    if (destFile.exists() && !destFile.isWriteable()) {
                        destFile.setWritable(true, false);
                    }
                    // Remove all files and folders within the working area.
                    baseDir.delete(Selectors.SELECT_ALL);
                }
            }
        }
    }
}

