    private DefaultFileSystemManager manager;
    private File tempDir;
    private FileObject baseFolder;
    private FileObject readFolder;
    private FileObject writeFolder;

    /**
     * During setup, initialize the file system manager.
     */
    @BeforeEach
    public void setUp() throws Exception {
        final String uri = System.getProperty("test.sftp.uri");
        assumeTrue(uri != null && !uri.isEmpty(), "The system property 'test.sftp.uri' must be configured to run this test.");

        manager = new DefaultFileSystemManager();
        final FilesCache filesCache = manager.getFilesCache();

        tempDir = new File("target/test/sftptemp").getAbsoluteFile();
        FileUtils.deleteQuietly(tempDir);
        tempDir.mkdirs();

        final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        final PrivilegedFileReplicator privilegedReplicator = new PrivilegedFileReplicator(replicator);

        manager.setReplicator(privilegedReplicator);
        manager.setTemporaryFileStore(privilegedReplicator);

        if (!manager.hasProvider("sftp")) {
            manager.addProvider("sftp", new SftpFileProvider());
        }
        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }

        manager.init();

        baseFolder = manager.resolveFile(uri);
        readFolder = baseFolder.resolveFile("read-tests");
        writeFolder = baseFolder.resolveFile("write-tests");

        assertTrue(readFolder.exists(), "Read folder should exist.");
        assertFalse(readFolder.isRoot(), "Read folder should not be the root path.");
    }

    /**
     * During teardown, close all file object references.
     */
    @AfterEach
    public void tearDown() throws Exception {
        if (readFolder != null) {
            readFolder.close();
        }
        if (writeFolder != null) {
            writeFolder.close();
        }
        if (baseFolder != null) {
            baseFolder.close();
        }

        System.gc();
        Thread.sleep(100);
        System.gc();
        Thread.sleep(100);
        System.gc();
        Thread.sleep(100);

        if (manager != null) {
            manager.close();
        }

        Thread.sleep(200);

        assertEmpty(tempDir);
        FileUtils.deleteQuietly(tempDir);

        VFS.close();
    }

    private FileObject getWriteFolder() {
        return writeFolder;
    }

    private void assertEmpty(final File file) {
        if (file != null && file.exists()) {
            if (file.isDirectory()) {
                final String[] children = file.list();
                assertNotNull(children);
                assertEquals(0, children.length, "Directory should be empty: " + file.getAbsolutePath());
            } else {
                assertTrue(false, "Should be a directory or not exist, but is a file: " + file.getAbsolutePath());
            }
        }
    }

    @Test
    public void testWriteToReadOnlyFileThrowsException() throws Exception {
        final FileObject writeDir = getWriteFolder();
        final FileObject readOnlyFile = writeDir.resolveFile("read-only-file.txt");
        readOnlyFile.createFile();

        try {
            readOnlyFile.setWritable(false, false);
            final FileObject sourceFile = writeDir.resolveFile("file1.txt");
            sourceFile.createFile();
            try {
                assertThrows(FileSystemException.class, () -> readOnlyFile.copyFrom(sourceFile, null),
                        "Attempting to write to a read-only file should throw a FileSystemException.");
            } finally {
                sourceFile.delete();
            }
        } finally {
            readOnlyFile.setWritable(true, true);
            readOnlyFile.delete();
        }
    }
}

