/**
 * Create a test case to validate that the system's configuration mechanism for remote file access properly manages
 * timeout and identification settings through both legacy and modern configuration approaches, ensuring backward
 * compatibility while supporting newer standards.
 */
public class HttpFileSystemConfigBuilderTest {

    private final HttpFileSystemConfigBuilder builder = HttpFileSystemConfigBuilder.getInstance();

    @Test
    public void testTimeoutAndIdentifierConfiguration() {
        final FileSystemOptions opts = new FileSystemOptions();
        final String customIdentifier = "MyCustomVFS/1.0";
        final int oneMinuteMillis = (int) TimeUnit.MINUTES.toMillis(1);
        final Duration oneMinuteDuration = Duration.ofMinutes(1);

        // 1. Establish a fresh context and verify initial default values.
        // The builder provides accessors to the options map; it does not hold defaults itself.
        // Defaults are typically applied by the provider when consuming the options.
        assertEquals(0, builder.getConnectionTimeout(opts), "Default connection timeout should be 0");
        assertEquals(0, builder.getSoTimeout(opts), "Default socket timeout should be 0");
        assertNull(builder.getUserAgent(opts), "Default user agent should be null in the options before provider access");

        // 2. Apply timeout settings using the legacy millisecond-based configuration approach.
        builder.setConnectionTimeout(opts, oneMinuteMillis);
        builder.setSoTimeout(opts, oneMinuteMillis);
        builder.setUserAgent(opts, customIdentifier);

        // 3. Verify the system reflects these changes correctly.
        assertEquals(oneMinuteMillis, builder.getConnectionTimeout(opts), "Legacy connection timeout should be set");
        assertEquals(oneMinuteMillis, builder.getSoTimeout(opts), "Legacy socket timeout should be set");
        assertEquals(oneMinuteDuration, builder.getConnectionTimeoutDuration(opts),
                "Modern connection timeout should reflect the legacy setting");
        assertEquals(customIdentifier, builder.getUserAgent(opts), "Custom identifier should be set");

        // 4. Reconfigure the same timeout settings using the modern duration-based configuration approach.
        builder.setConnectionTimeoutDuration(opts, oneMinuteDuration);
        builder.setSoTimeoutDuration(opts, oneMinuteDuration);

        // 5. Verify the system maintains consistency across both configuration styles.
        assertEquals(oneMinuteMillis, builder.getConnectionTimeout(opts),
                "Legacy connection timeout should be consistent after modern update");
        assertEquals(oneMinuteMillis, builder.getSoTimeout(opts),
                "Legacy socket timeout should be consistent after modern update");
        assertEquals(oneMinuteDuration, builder.getConnectionTimeoutDuration(opts), "Modern connection timeout should be set correctly");
        assertEquals(oneMinuteDuration, builder.getSoTimeoutDuration(opts), "Modern socket timeout should be set correctly");
        assertEquals(customIdentifier, builder.getUserAgent(opts), "Identifier should remain unchanged throughout all configuration updates");
    }
}

