 * operation fails with the appropriate error when trying to open a stream to a non-existent resource.
 */
public class MissingFileAccessTest {

    private static final String TEST_READ_URL_PROPERTY = "test.read.url";
    private static final String MISSING_FILE_NAME = "file-does-not-exist.txt";

    private static File temporaryStorageArea;
    private static StandardFileSystemManager manager;

    @BeforeAll
    public static void setupEnvironment() throws IOException {
        // Establish a clean working environment
        temporaryStorageArea = new File("target/test-temp-storage").getAbsoluteFile();
        FileUtils.deleteDirectory(temporaryStorageArea);
        assertTrue(temporaryStorageArea.mkdirs(), "Failed to create temporary storage area.");

        // Configure the file system management layer
        manager = new StandardFileSystemManager();
        manager.setFilesCache(new OnCallReplicationCache());
        manager.setReplicator(new DefaultFileReplicator(temporaryStorageArea));
        manager.setTemporaryFileStore(new DefaultLocalFileProvider());
        manager.init(); // Supports local and remote file protocols

        // Set up global VFS context
        VFS.setManager(manager);
    }

    @AfterAll
    public static void tearDownEnvironment() throws IOException {
        // Shut down the file system manager and verify cleanup
        if (manager != null) {
            manager.close();
        }
        if (temporaryStorageArea != null) {
            FileUtils.deleteDirectory(temporaryStorageArea);
        }
        // Close the global file system context
        VFS.setManager(null);
    }

    @Test
    public void testAccessMissingFileContentStreamFails() throws FileSystemException {
        // Begin by confirming that the necessary remote file system configuration is available
        final String readOnlyFolderPath = System.getProperty(TEST_READ_URL_PROPERTY);
        assumeTrue(readOnlyFolderPath != null,
                "Skipping test: Environment not configured for remote file access (missing property: "
                        + TEST_readOnlyFolderPath + ").");

        // Identify the designated read-only folder and verify it
        try (final FileObject readFolder = manager.resolveFile(readOnlyFolderPath)) {
            assertNotNull(readFolder);
            assertTrue(readFolder.exists(), "Read folder must exist.");
            assertTrue(readFolder.isFolder(), "Read folder must be a directory.");
            assertFalse(readFolder.getName().isRoot(), "Read folder must not be at the root level.");

            // Attempt to locate a non-existent file
            try (final FileObject missingFile = readFolder.resolveFile(MISSING_FILE_NAME)) {
                assertNotNull(missingFile);
                assertFalse(missingFile.exists(), "File should not exist before access attempt.");

                // Expect a FileSystemException when trying to obtain an input stream
                final FileSystemException e = assertThrows(FileSystemException.class, () -> {
                    missingFile.getContent().getInputStream().close();
                }, "Accessing content of a non-existent file should throw an exception.");

                // Check for an appropriate error indicating the file does not exist
                assertTrue(e.getMessage().contains("does not exist"),
                        "Exception message should indicate the file does not exist.");
            }
        }
        // Resources are released via try-with-resources and @AfterAll
    }
