        final File archiveFile = new File(tempDir, "test-archive.zip");

        try (ZipOutputStream zos = new ZipOutputStream(new FileOutputStream(archiveFile))) {
            final ZipEntry entry = new ZipEntry("test-resource.txt");
            zos.putNextEntry(entry);
            zos.write("test content".getBytes());
            zos.closeEntry();
        }

        final DefaultFileSystemManager fsManager = new DefaultFileSystemManager();
        try {
            // Configure the file system manager with local and zip file providers
            fsManager.addProvider("file", new DefaultLocalFileProvider());
            fsManager.addProvider("zip", new ZipFileProvider());
            fsManager.init();

            // Construct the specialized resource URI for the entry within the zip archive
            final String resourceUri = "zip:" + archiveFile.toURI().toString() + "!/test-resource.txt";

            // Resolve the resource and verify its existence
            final FileObject resource = fsManager.resolveFile(resourceUri);
            assertTrue(resource.exists(), "Resource should exist within the archive.");

        } finally {
            // Release all file system resources
            if (fsManager != null) {
                fsManager.close();
            }
            // Clean up the temporary workspace
            archiveFile.delete();
            tempDir.delete();
        }
    }
}

