/**
 * Tests that the system correctly handles file resolution when provided with a resource address containing an IPv6
 * network location.
 */
public class DefaultFileSystemManagerIPv6Test {

    /**
     * A provider that supports URI parsing but does not create a file system, for isolation from network
     * dependencies.
     */
    private static class TestHttpProvider extends AbstractFileProvider {
        @Override
        public FileSystem doCreateFileSystem(final FileName rootName, final FileSystemOptions fileSystemOptions)
                throws FileSystemException {
            throw new UnsupportedOperationException("This test provider does not create file systems.");
        }

        @Override
        public Collection<Capability> getCapabilities() {
            return Collections.unmodifiableCollection(Arrays.asList(Capability.URI));
        }
    }

    @Test
    public void testResolveFileWithIPv6AndZoneId() throws FileSystemException {
        final DefaultFileSystemManager manager = new DefaultFileSystemManager();
        FileProvider originalProvider = null;

        try {
            // Establish a clean working environment and configure the manager.
            manager.init();

            // Temporarily replace the standard HTTP provider with a testing implementation.
            if (manager.hasProvider("http")) {
                originalProvider = manager.getProvider("http");
            }
            manager.addProvider("http", new TestHttpProvider());

            // Construct a resource address with an IPv6 address, zone identifier, and credentials.
            final String ipv6Uri = "http://user:pass@[fe80::1%eth0]/path/to/file.txt";

            // Request the system to resolve the address.
            final FileObject fileObject = manager.resolveFile(ipv6Uri);

            // Verify that the resolved resource's root location preserves the network address and credentials.
            final String expectedRootUri = "http://user:pass@[fe80::1%eth0]/";
            assertThat(fileObject.getName().getRootURI()).isEqualTo(expectedRootUri);

            // Verify that the complete resource address is accurately maintained.
            assertThat(fileObject.getName().getURI()).isEqualTo(ipv6Uri);

        } finally {
            // Restore the original provider and clean up resources.
            if (originalProvider != null) {
                manager.addProvider("http", originalProvider);
            } else {
                manager.removeProvider("http");
            }
            manager.close();
        }
    }
}

