        assertEmpty(tempDir, "Temp dir not empty after test");

        VFS.close();
    }

    private FileObject getWriteFolder() throws Exception {
        final FileSystem newFs = manager.createVirtualFileSystem("vfs:").getFileSystem();
        newFs.addJunction("/some/dir", writeFolder);
        return newFs.resolveFile("/some/dir");
    }

    @Test
    public void testCopyToReadOnlyFileThrowsException() throws Exception {
        assumeTrue(System.getProperty("test.sftp.uri") != null,
                "Test requires SFTP server configured via system property");

        final FileObject scratchFolder = getWriteFolder();

        final FileObject readOnlyFile = scratchFolder.resolveFile("read-only-file.txt");
        final FileObject sourceFile = scratchFolder.resolveFile("file1.txt");
        try {
            sourceFile.createFile();
            readOnlyFile.createFile();
            readOnlyFile.setWritable(false, false);

            assertThrows(FileSystemException.class, () -> {
                readOnlyFile.copyFrom(sourceFile, null);
            });
        } finally {
            if (sourceFile.exists()) {
                sourceFile.delete();
            }
            if (readOnlyFile.exists()) {
                readOnlyFile.setWritable(true, false);
                readOnlyFile.delete();
            }
        }
    }
