 */
public class SftpMissingFileTest {

    private static final String SFTP_URI_PROPERTY = "sftp.uri";
    private static final String READ_FOLDER_PATH = "read-folder";
    private static final String WRITE_FOLDER_PATH = "write-folder";
    private static final String NON_EXISTENT_FILENAME = "non-existent-file.txt";

    private File locateTestDir() throws IOException {
        return Files.createTempDirectory("vfs-sftp-test-").toFile();
    }

    private void cleanTestDir(final File testDir) throws IOException {
        if (testDir != null && testDir.exists()) {
            FileUtils.cleanDirectory(testDir);
        }
    }

    private boolean isDirEmpty(final File testDir) throws IOException {
        return !testDir.exists() || !testDir.isDirectory() || FileUtils.isEmptyDirectory(testDir);
    }

    private void validateAndCleanupDir(final File testDir) throws IOException {
        if (testDir != null) {
            if (testDir.exists()) {
                FileUtils.deleteDirectory(testDir);
            }
        }
    }

    @Test
    public void testOpenInputStreamOnNonExistentFile() throws Exception {
        final String sftpUri = System.getProperty(SFTP_URI_PROPERTY);
        Assumptions.assumeTrue(sftpUri != null && !sftpUri.isEmpty(),
                "SFTP URI not set (system property 'sftp.uri'), skipping test.");

        File tempDir = null;
        DefaultFileSystemManager manager = null;
        FileObject baseFolder = null;
        FileObject readFolder = null;
        FileObject writeFolder = null;

        try {
            // Setup
            tempDir = locateTestDir();
            cleanTestDir(tempDir);
            assertTrue(isDirEmpty(tempDir), "Temporary directory should be empty at the start.");

            manager = new DefaultFileSystemManager();
            manager.setFilesCache(new DefaultFilesCache());

            final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
            final PrivilegedFileReplicator privilegedReplicator = new PrivilegedFileReplicator(replicator);
            manager.setReplicator(privilegedReplicator);
            manager.setTemporaryFileStore(privilegedReplicator);

            if (!manager.hasProvider("sftp")) {
                manager.addProvider("sftp", new SftpFileProvider());
            }
            if (!manager.hasProvider("file")) {
                manager.addProvider("file", new DefaultLocalFileProvider());
            }
            manager.init();

            baseFolder = manager.resolveFile(sftpUri);
            readFolder = baseFolder.resolveFile(READ_FOLDER_PATH);
            writeFolder = baseFolder.resolveFile(WRITE_FOLDER_PATH); // For teardown consistency

            assertTrue(readFolder.exists(), "Read folder must exist for the test to run.");
            assertNotEquals("/", readFolder.getName().getPath(), "Read folder path should not be the root.");

            final FileObject nonExistentFile = readFolder.resolveFile(NON_EXISTENT_FILENAME);
            assertFalse(nonExistentFile.exists(), "File should not exist before test.");

            // Test
            assertThrows(FileSystemException.class, () -> {
                try (final InputStream is = nonExistentFile.getContent().getInputStream()) {
                    fail("Should have thrown FileSystemException before the stream is utilized.");
                }
            });

        } finally {
            // Teardown
            if (readFolder != null) {
                readFolder.close();
            }
            if (writeFolder != null) {
                writeFolder.close();
            }
            if (baseFolder != null) {
                baseFolder.close();
            }

            // Garbage collection to help clean up soft references, as per description
            System.gc();
            System.gc();

            if (manager != null) {
                manager.freeUnusedResources();
                manager.close();
            }

            validateAndCleanupDir(tempDir);

            // Per description, though closing the local manager is usually sufficient
            if (VFS.getManager() instanceof DefaultFileSystemManager) {
                ((DefaultFileSystemManager) VFS.getManager()).close();
            }
        }
    }
}

