/**
 * A test case for file resolution with the resource-based URI scheme.
 */
public class ResourceSchemeTest {

    private DefaultFileSystemManager manager;
    private File tempDir;
    private FileObject baseFolder;
    private FileObject readFolder;
    private FileObject writeFolder;

    @BeforeEach
    public void setUp() throws Exception {
        // Configure and clean a temporary directory
        tempDir = new File("target/test/res-test").getAbsoluteFile();
        FileUtils.deleteQuietly(tempDir);
        tempDir.mkdirs();
        validateDirState(tempDir, true);

        // Instantiate and configure the File System Manager
        manager = new DefaultFileSystemManager();
        manager.setFilesCache(new DefaultFilesCache());
        final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        manager.setReplicator(new PrivilegedFileReplicator(replicator));
        manager.setTemporaryFileStore(replicator);

        // Register providers
        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }
        manager.addProvider("res", new ResourceFileProvider());

        // Initialize the manager
        manager.init();

        // Resolve base folders for tests
        final String baseDirUri = new File(".").getAbsoluteFile().toURI().toString();
        System.setProperty("test.basedir.uri", baseDirUri);
        baseFolder = manager.resolveFile(System.getProperty("test.basedir.uri"));

        // The res: scheme does not require a virtual FS junction.
        // It resolves from the classpath directly.

        readFolder = manager.resolveFile(baseFolder, "src/test/resources/test-data");
        writeFolder = manager.resolveFile(tempDir.toURI().toString());

        Assertions.assertTrue(readFolder.exists());
        Assertions.assertNotEquals("/", readFolder.getName().getPath());
    }

    @AfterEach
    public void tearDown() throws Exception {
        if (readFolder != null) {
            readFolder.close();
        }
        if (writeFolder != null) {
            writeFolder.close();
        }
        if (baseFolder != null) {
            baseFolder.close();
        }

        // Give soft references a chance to be collected
        System.gc();
        Thread.sleep(100);
        System.gc();
        Thread.sleep(100);

        if (manager != null) {
            manager.freeUnusedResources();
            manager.close();
        }

        // Pause to allow background threads to terminate
        Thread.sleep(1000);

        validateDirState(tempDir, false);

        // VFS.close() is commented out to avoid interfering with other tests
        // that might rely on the global VFS instance. This test manages its own manager.
        // VFS.close();
    }

    /**
     * Verifies that a file object can be resolved using the 'res' scheme.
     * The resource is expected to be in the classpath.
     */
    @Test
    public void testResolveFileResource() throws FileSystemException {
        final FileObject resourceFile = manager.resolveFile("res:test-data/nested.zip");
        Assertions.assertTrue(resourceFile.exists(), "Resource file should exist.");
    }

    /**
     * Helper to validate the state of a directory (empty or removed).
     */
    private void validateDirState(final File dir, final boolean shouldExist) {
        if (shouldExist) {
            Assertions.assertTrue(dir.exists(), "Directory should exist: " + dir.getPath());
            Assertions.assertTrue(dir.isDirectory(), "Path should be a directory: " + dir.getPath());
            final String[] children = dir.list();
            Assertions.assertNotNull(children, "Directory listing should not be null.");
            Assertions.assertEquals(0, children.length, "Directory should be empty.");
        } else {
            Assertions.assertFalse(dir.exists() && dir.list().length > 0, "Directory should be removed or empty.");
        }
    }
}

