/**
 * Tests for SFTP URI parsing with IPv6 addresses.
 */
public class SftpResolveIpv6UrlTest {

    private static boolean isSetUp;
    private static DefaultFileSystemManager manager;

    private FileObject baseFolder;
    private FileObject readFolder;
    private FileObject writeFolder;

    private static final String READ_TESTS_FOLDER = "read-tests";
    private static final String WRITE_TESTS_FOLDER = "write-tests";

    /**
     * A mock SFTP provider that does not establish a real connection.
     */
    public static class MockedClientSftpFileProvider extends SftpFileProvider {
        public MockedClientSftpFileProvider() {
            // No-op constructor as per test description.
        }
    }

    private File getTestDirectory(final String name) {
        final File dir = new File("target/test-data/" + name);
        dir.mkdirs();
        return dir;
    }

    private void checkTempDir(final String message) throws IOException {
        final File tempDir = getTestDirectory("temp");
        FileUtils.cleanDirectory(tempDir);
        if (tempDir.exists()) {
            assertTrue(tempDir.isDirectory(), message + " (" + tempDir.getAbsolutePath() + ")");
            assertTrue(tempDir.list().length == 0, message + " (" + tempDir.getAbsolutePath() + ")");
        }
    }

    public static DefaultFileSystemManager getManager() {
        return manager;
    }

    @BeforeEach
    public void setUp() throws Exception {
        if (isSetUp) {
            return;
        }
        isSetUp = true;

        checkTempDir("Temp dir not empty before test");

        manager = new DefaultFileSystemManager();
        manager.setFilesCache(new DefaultFilesCache());

        final File tempDir = getTestDirectory("temp");
        final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        manager.setReplicator(replicator);
        manager.setTemporaryFileStore(replicator);

        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }
        manager.init();

        final String uri = System.getProperty("TEST_URI");
        if (uri != null) {
            baseFolder = manager.resolveFile(uri);
        } else {
            final File baseDir = getTestDirectory("base-folder");
            baseFolder = manager.resolveFile(baseDir.getAbsolutePath());
        }

        if (baseFolder != null) {
            readFolder = baseFolder.resolveFile(READ_TESTS_FOLDER);
            readFolder.createFolder();
            writeFolder = baseFolder.resolveFile(WRITE_TESTS_FOLDER);
            assertTrue(readFolder.exists(), "Folder does not exist: " + readFolder);
            assertNotEquals(FileName.ROOT_PATH, readFolder.getName().getPath());
        }
    }

    @AfterEach
    public void tearDown() throws Exception {
        if (readFolder != null) {
            readFolder.close();
            readFolder = null;
        }
        if (writeFolder != null) {
            writeFolder.close();
            writeFolder = null;
        }
        if (baseFolder != null) {
            baseFolder.close();
            baseFolder = null;
        }

        System.gc();
        Thread.sleep(1000L);
        System.gc();
        Thread.sleep(1000L);
        System.gc();
        Thread.sleep(1000L);
        System.gc();
        Thread.sleep(1000L);

        if (manager != null) {
            manager.freeUnusedResources();
            manager.close();
            manager = null;
        }

        Thread.sleep(20L);

        checkTempDir("Temp dir not empty after test");

        VFS.close();
    }

    @Test
    public void testResolveIpv6Url() throws FileSystemException {
        try {
            getManager().removeProvider("sftp");
            getManager().addProvider("sftp", new MockedClientSftpFileProvider());

            final String ipv6Url = "sftp://user:pass @[fe80::1c42:dae:8370:aea6%en1]/file.txt";
            final FileObject fileObject = getManager().resolveFile(ipv6Url, new FileSystemOptions());

            assertEquals("sftp://user:pass @[fe80::1c42:dae:8370:aea6%en1]/", fileObject.getFileSystem().getRootURI());
            assertEquals("sftp://user:pass @[fe80::1c42:dae:8370:aea6%en1]/file.txt", fileObject.getName().getURI());
        } finally {
            getManager().removeProvider("sftp");
            getManager().addProvider("sftp", new SftpFileProvider());
        }
    }
}

