/**
 * Test class to validate file resolution with SMB support.
 */
public class SmbProviderResolvingTest {

    private static DefaultFileSystemManager manager;
    private static FileObject baseFolder;
    private static FileObject readFolder;
    private static FileObject writeFolder;
    private static File tempDir;
    private static File baseDir;

    @BeforeAll
    public static void setUp() throws IOException {
        manager = new DefaultFileSystemManager();
        manager.setFilesCache(new DefaultFilesCache());

        tempDir = File.createTempFile("vfs-temp-", ".dir");
        tempDir.delete();
        tempDir.mkdir();
        DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        manager.setReplicator(new PrivilegedFileReplicator(replicator));
        manager.setTemporaryFileStore(replicator);

        manager.addProvider("smb", new SmbFileProvider());
        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }
        // Add the resource provider for the test
        manager.addProvider("res", new ResourceFileProvider());

        manager.init();

        baseDir = File.createTempFile("vfs-base-", ".dir");
        baseDir.delete();
        baseDir.mkdir();

        baseFolder = manager.resolveFile(baseDir.toURI());
        readFolder = baseFolder.resolveFile("read");
        readFolder.createFolder();
        writeFolder = baseFolder.resolveFile("write");
        writeFolder.createFolder();

        assertTrue(readFolder.exists());
        assertNotEquals("/", readFolder.getName().getPath());
    }

    @AfterAll
    public static void tearDown() throws Exception {
        if (readFolder != null) {
            readFolder.close();
        }
        if (writeFolder != null) {
            writeFolder.close();
        }
        if (baseFolder != null) {
            baseFolder.close();
        }

        // Trigger garbage collection multiple times with brief pauses
        for (int i = 0; i < 5; i++) {
            System.gc();
            try {
                Thread.sleep(100);
            } catch (final InterruptedException e) {
                // Restore interrupted state
                Thread.currentThread().interrupt();
            }
        }

        if (manager != null) {
            manager.freeUnusedResources();
            manager.close();
        }

        // Pause to allow background threads to complete
        try {
            Thread.sleep(1000);
        } catch (final InterruptedException e) {
            // Restore interrupted state
            Thread.currentThread().interrupt();
        }

        assertDirEmptyOrAbsent(tempDir);
        FileUtils.deleteQuietly(baseDir);

        // VFS.close() is not a public API, closing the manager is sufficient.
    }

    private static void assertDirEmptyOrAbsent(final File dir) throws IOException {
        if (dir == null) {
            return;
        }
        if (!dir.exists()) {
            return;
        }
        if (dir.isDirectory()) {
            final File[] files = dir.listFiles();
            if (files == null || files.length == 0) {
                return;
            }
            fail("Directory '" + dir.getAbsolutePath() + "' is not empty. Files: " + files.length);
        } else {
            fail("Path is not a directory: " + dir.getAbsolutePath());
        }
    }

    @Test
    public void testResolveResourceFile() throws FileSystemException {
        // The test description is contradictory, it sets up an SMB provider but resolves a resource.
        // Following the literal test method description.
        final FileObject fileObject = manager.resolveFile("res:test-data/test.zip");
        assertTrue(fileObject.exists(), "Resolved file should exist.");
    }
}

