 * support.
 */
public class SmbUriResolutionTest {

    private File testDir;
    private DefaultFileSystemManager manager;
    private FileObject baseFolder;
    private FileObject readFolder;
    private FileObject writeFolder;

    /**
     * Asserts that a directory is empty or does not exist.
     *
     * @param dir The directory to check.
     */
    private static void assertEmptyOrMissing(final File dir) {
        if (dir.exists()) {
            final String[] children = dir.list();
            if (children != null && children.length > 0) {
                fail("Directory '" + dir.getAbsolutePath() + "' is not empty.");
            }
        }
    }

    @BeforeEach
    public void setUp() throws Exception {
        // Establish a temporary directory for file replication.
        testDir = new File("target/test-smb-uri-resolution").getAbsoluteFile();
        FileUtils.deleteQuietly(testDir);
        testDir.mkdirs();

        // Initialize a file system manager with a files cache, file replicator wrapped in a privileged execution
        // context, and temporary file store.
        manager = new DefaultFileSystemManager();
        manager.setFilesCache(new SoftRefFilesCache());
        manager.setFileReplicator(new PrivilegedFileReplicator(new DefaultFileReplicator(testDir)));
        manager.setTemporaryFileStore(new TemporaryFileStore(testDir));

        // Register an SMB file provider and a default local file provider if not already present.
        manager.addProvider("smb", new SmbFileProvider());
        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }
        manager.addProvider("res", new ResourceFileProvider());

        // Initialize the manager.
        manager.init();

        // Resolve base test folders from a system property URI to create read and write folder references.
        final File baseFile = new File("src/test/resources").getAbsoluteFile();
        System.setProperty("test.basedir.uri", baseFile.toURI().toString());
        baseFolder = manager.resolveFile(System.getProperty("test.basedir.uri"));
        readFolder = baseFolder.resolveFile("test-data");
        writeFolder = baseFolder.resolveFile("test-data-write");

        // Assert the read folder exists and is not the root path.
        assertTrue(readFolder.exists(), "Read folder should exist.");
        assertFalse(readFolder.isRoot(), "Read folder should not be the root path.");
    }

    @AfterEach
    public void tearDown() throws Exception {
        // Close any open read, write, and base folder file objects if they exist.
        if (readFolder != null) {
            readFolder.close();
        }
        if (writeFolder != null) {
            writeFolder.close();
        }
        if (baseFolder != null) {
            baseFolder.close();
        }

        // Trigger multiple garbage collection cycles with intervening thread sleep intervals to allow soft reference
        // cleanup.
        System.gc();
        Thread.sleep(1000);
        System.gc();
        Thread.sleep(1000);

        // Free unused resources from the file system manager and close it.
        if (manager != null) {
            manager.freeUnusedResources();
            manager.close();
        }

        // Pause briefly to allow background threads to terminate.
        Thread.sleep(1000);

        // Verify the temporary directory is empty or removed.
        assertEmptyOrMissing(testDir);
        FileUtils.deleteQuietly(testDir);

        // Close the global VFS singleton.
        VFS.close();
    }

    @Test
    public void testResolveUriToFileType() throws FileSystemException {
        // Retrieve the initialized file system manager and invoke its URI resolution capability
        // with the resource URI string "res:test-data/test.zip" to obtain a file name object.
        final FileSystemManager fsManager = VFS.getManager();
        final FileName fileName = fsManager.resolveURI("res:test-data/nested.zip");

        // Assert that the returned file name represents a regular file type.
        assertEquals(FileType.FILE, fileName.getType());
    }
}

