 */
public class FileSystemManagerTest {

    @Test
    public void testResolvePartialResourceAsFile() throws Exception {
        // Establish a clean temporary workspace by ensuring the designated temporary location exists as an empty directory.
        final File tempDir = Files.createTempDirectory("vfs-test-").toFile();

        // Configure a file system manager with appropriate caching behavior, file replication capabilities for handling
        // temporary copies, and temporary file storage.
        final DefaultFileSystemManager manager = new DefaultFileSystemManager();
        manager.setFilesCache(new DefaultFilesCache());
        final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        manager.setReplicator(replicator);

        // Register the necessary file access providers including support for local files and network shares.
        manager.addProvider("file", new DefaultLocalFileProvider());
        manager.addProvider("res", new ResourceFileProvider());

        // Initialize the manager.
        manager.init();

        // Prepare base folders for read and write operations while confirming the read location exists and is not at the root level.
        final FileObject baseFolder = manager.resolveFile(tempDir.toURI().toString());
        final FileObject readFolder = manager.resolveFile(baseFolder, "read");
        readFolder.createFolder();
        final FileObject writeFolder = manager.resolveFile(baseFolder, "write");
        writeFolder.createFolder();

        assertTrue(readFolder.exists(), "Read folder should exist.");
        assertFalse(readFolder.isRoot(), "Read folder should not be the root.");

        // Instruct the system to resolve the partial resource identifier "res:test-data" into a file reference.
        final FileObject resourceFile = manager.resolveFile("res:test-data");

        // Verify that the resolved reference represents a regular file rather than a directory or other file type.
        assertNotNull(resourceFile, "Resolved file should not be null.");
        assertEquals(FileType.FILE, resourceFile.getType(), "Resolved resource should be a file.");

        // Release all file references by closing the read folder, write folder, and base folder.
        readFolder.close();
        writeFolder.close();
        baseFolder.close();

        // Trigger resource cleanup to allow background processes to free cached files.
        manager.freeUnusedResources();

        // Close the file system manager to release all associated resources.
        manager.close();

        // Confirm the temporary workspace is empty or removed.
        FileUtils.deleteDirectory(tempDir);
        assertFalse(tempDir.exists(), "Temporary directory should have been deleted.");

        // Close the global file system context.
        VFS.reset();
    }
}

