    private FileObject readFolder;
    private FileObject writeFolder;
    private File tempDir;
    private File testDataFile;

    @BeforeEach
    public void setUp() throws Exception {
        // Configure a provider test suite that initializes a Default File System Manager
        manager = new DefaultFileSystemManager();

        // with an SMB file provider registered under the "smb" scheme
        if (!manager.hasProvider("smb")) {
            manager.addProvider("smb", new SmbFileProvider());
        }

        // establishes a files cache
        manager.setFilesCache(new DefaultFilesCache());

        // and temporary file store backed by a Default File Replicator operating within a cleaned temporary directory
        final String baseTmpDir = System.getProperty("java.io.tmpdir");
        tempDir = new File(baseTmpDir, "UriResolutionTest-temp");
        if (tempDir.exists()) {
            delete(tempDir);
        }
        tempDir.mkdirs();

        final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);

        // wraps the replicator in a Privileged File Replicator for security context
        final PrivilegedFileReplicator privilegedReplicator = new PrivilegedFileReplicator(replicator);
        manager.setTemporaryFileStore(privilegedReplicator);

        // conditionally registers a Default LocalFileProvider for the "file" scheme if not already present,
        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }

        // and initializes the manager to prepare it for URI resolution operations.
        manager.init();

        // retrieve the base test folder by resolving a URI obtained from system properties
        final String path = System.getProperty("test.basedir", ".");
        baseFolder = manager.resolveFile(new File(path).getAbsolutePath());

        // then create a virtual file system with a root URI of "vfs:"
        final VirtualFileProvider vfsProvider = new VirtualFileProvider();
        manager.addProvider("vfs", vfsProvider);

        // and add a junction at the path "/some/dir" linking to the base test folder
        vfsProvider.addJunction("/some/dir", baseFolder);

        // finally resolving this junction path to obtain the effective base folder for testing.
        this.readFolder = manager.resolveFile("vfs:///some/dir");

        // Set up for the test case itself
        manager.addProvider("res", new DefaultLocalFileProvider());
        testDataFile = new File("test-data");
        testDataFile.createNewFile();
    }

    @Test
    public void testUriResolution() throws FileSystemException {
        // invoke the manager's URI resolution capability with the resource URI "res:test-data" to obtain a FileName instance,
        final FileName fileName = manager.resolveURI("res:test-data");

        // then assert that the returned FileName represents a file type by verifying its file classification status returns true.
        assertTrue(fileName.getType().hasContent());
    }

    @AfterEach
    public void tearDown() throws Exception {
        // close the read folder, write folder, and base folder file objects if they exist,
        FileObject.closeQuietly(readFolder);
        FileObject.closeQuietly(writeFolder);
        FileObject.closeQuietly(baseFolder);

        // trigger multiple garbage collection cycles with intervening thread sleeps to allow resource cleanup,
        System.gc();
        Thread.sleep(100);
        System.gc();
        Thread.sleep(100);

        // instruct the manager to free unused resources and close itself,
        if (manager != null) {
            manager.freeUnusedResources();
            manager.close();
        }

        // pause briefly to allow background threads to terminate,
        Thread.sleep(1000);

        // create a helper that validates the temporary directory is either absent or empty
        validateTempDirEmpty();

        // close the VFS singleton to release all global file system resources.
        VFS.close();

        if (testDataFile != null && testDataFile.exists()) {
            testDataFile.delete();
        }
        if (tempDir != null && tempDir.exists()) {
            delete(tempDir);
        }
    }

    private void validateTempDirEmpty() {
        if (tempDir == null) {
            return;
        }
        if (tempDir.exists()) {
            final String[] children = tempDir.list();
            if (children != null && children.length > 0) {
                fail("Temporary directory '" + tempDir.getAbsolutePath() + "' is not empty.");
            }
        }
    }

    private void delete(final File file) throws IOException {
        if (file.isDirectory()) {
            final File[] children = file.listFiles();
            if (children != null) {
                for (final File child : children) {
                    delete(child);
                }
            }
        }
        if (!file.delete()) {
            throw new IOException("Unable to delete " + file);
        }
    }
}

