/**
 * Defines a test class that validates URI resolution behavior within a virtual file system manager configured with
 * SMB provider support.
 */
public class SmbUriResolutionTest {

    private static DefaultFileSystemManager manager;
    private static File tempDir;
    private static FileObject baseFolder;
    private static FileObject readFolder;
    private static FileObject writeFolder;

    @BeforeAll
    public static void setUp() throws Exception {
        // Establish temporary directory for file replication and clean it
        tempDir = new File(FileUtils.getTempDirectory(), SmbUriResolutionTest.class.getName());
        FileUtils.forceMkdir(tempDir);
        FileUtils.cleanDirectory(tempDir);

        // Obtain and configure file system manager
        manager = new DefaultFileSystemManager();
        manager.setFilesCache(new DefaultFilesCache());

        // Instantiate replicator and temporary file store
        final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        final PrivilegedFileReplicator privilegedReplicator = new PrivilegedFileReplicator(replicator);
        final DefaultTemporaryFileStore tempFileStore = new DefaultTemporaryFileStore(manager, tempDir);

        manager.setReplicator(privilegedReplicator);
        manager.setTemporaryFileStore(tempFileStore);

        // Register SMB file provider
        manager.addProvider("smb", new SmbFileProvider());

        // Conditionally add local file provider
        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }

        // Add resource provider for the test URI
        if (!manager.hasProvider("res")) {
            manager.addProvider("res", new ResourceFileProvider());
        }

        // Initialize manager
        manager.init();

        // Retrieve base test folder from a system property URI
        final String baseUri = System.getProperty("test.basedir.uri", tempDir.toURI().toString());
        baseFolder = manager.resolveFile(baseUri);

        // Resolve child folders for read and write operations from this base folder
        readFolder = baseFolder.resolveFile("read-tests");
        readFolder.createFolder(); // Ensure folder exists for assertion
        writeFolder = baseFolder.resolveFile("write-tests");

        // Assert that the read folder exists and its path is not the root path
        assertTrue(readFolder.exists());
        assertNotEquals("/", readFolder.getName().getPath());
    }

    @AfterAll
    public static void tearDown() throws Exception {
        // Close file objects if they are not null
        if (readFolder != null) {
            readFolder.close();
        }
        if (writeFolder != null) {
            writeFolder.close();
        }
        if (baseFolder != null) {
            baseFolder.close();
        }

        // Trigger garbage collection multiple times with intervening thread sleep intervals
        System.gc();
        Thread.sleep(100);
        System.gc();
        Thread.sleep(1000);

        // Instruct the manager to free unused resources and close it
        if (manager != null) {
            manager.freeUnusedResources();
            manager.close();
        }

        // Pause briefly to allow background threads to complete
        Thread.sleep(200);

        // Verify the temporary directory is empty or removed
        assertDirIsEmpty(tempDir);

        // Finally close the global VFS singleton
        VFS.close();
    }

    private static void assertDirIsEmpty(final File dir) {
        assertTrue(!dir.exists() || dir.isDirectory() && dir.list().length == 0,
                "Temporary directory should be empty or removed.");
    }

    @Test
    public void testManagerResolvesUriToFileType() throws Exception {
        // Invoke the manager's URI resolution capability with the resource URI
        final FileObject fileObject = manager.resolveFile("res:test-data/read-xml-tests.zip");
        assertNotNull(fileObject, "Resolved file object should not be null.");

        final FileName fileName = fileObject.getName();
        assertNotNull(fileName, "File name should not be null.");

        // Assert that the returned file name represents a regular file type
        assertEquals(FileType.FILE, fileName.getType(), "File name should represent a regular file type.");
    }
}

