import org.apache.commons.vfs2.provider.res.ResourceFileProvider;
import org.junit.jupiter.api.Test;

/**
 * Tests that the file system manager can correctly resolve a resource URI.
 */
public class FileSystemManagerResolveResourceTest {

    @Test
    public void testResolveResourceAsFile() throws Exception {
        // Establish a clean temporary workspace for the replicator
        final File tempDir = File.createTempFile("vfs-test-replicator-", ".tmp");
        tempDir.delete();
        tempDir.mkdirs();
        FileUtils.forceDeleteOnExit(tempDir);

        FileObject baseLocation = null;
        FileObject resourceFile = null;
        DefaultFileSystemManager manager = null;

        try {
            // Configure the file system manager
            manager = new DefaultFileSystemManager();
            manager.setCacheStrategy(new DefaultFilesCache());
            final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
            manager.setReplicator(replicator);
            manager.setTemporaryFileStore(replicator);

            final DefaultLocalFileProvider localFileProvider = new DefaultLocalFileProvider();
            manager.setDefaultProvider(localFileProvider); // Fallback for local file access
            manager.addProvider("file", localFileProvider);
            manager.addProvider("res", new ResourceFileProvider());
            manager.init();

            // Establish a base testing location
            final File testBaseDirFile = new File(tempDir, "base");
            testBaseDirFile.mkdir();
            baseLocation = manager.toFileObject(testBaseDirFile);

            // Attempt to resolve the URI into a file name reference
            // Using a resource that is known to exist in the test resources
            final String resourceUri = "res:test-data/read-xml-tests.zip";
            resourceFile = manager.resolveFile(resourceUri);

            // Verify that the resolved reference indicates a regular file type
            assertThat(resourceFile).isNotNull();
            assertThat(resourceFile.exists()).isTrue();
            assertThat(resourceFile.getType()).isEqualTo(FileType.FILE);

        } finally {
            // After completing the validation, release all file references
            if (resourceFile != null) {
                resourceFile.close();
            }
            if (baseLocation != null) {
                baseLocation.close();
            }

            // Allow the system to perform garbage collection
            System.gc();

            if (manager != null) {
                // Instruct the manager to release any unused resources and shut down completely
                manager.close();
            }

            // Confirm the temporary workspace is empty or removed
            assertThat(tempDir).doesNotExist();

            // Finally close the global file system context if it was ever initialized
            if (VFS.isInitialized()) {
                VFS.close();
            }
        }
    }
}

