package org.apache.commons.vfs2.provider.res;

import static org.junit.jupiter.api.Assertions.assertNotNull;
import static org.junit.jupiter.api.Assertions.assertTrue;

import org.apache.commons.vfs2.FileObject;
import org.apache.commons.vfs2.FileSystemException;
import org.apache.commons.vfs2.impl.DefaultFileSystemManager;
import org.apache.commons.vfs2.provider.local.DefaultLocalFileProvider;
import org.apache.commons.vfs2.provider.temp.TemporaryFileProvider;
import org.junit.jupiter.api.Test;

/**
 * Tests the system's ability to resolve partial resource paths in a layered manner.
 */
public class ResourceFileResolveTest {

    /**
     * Validates resolving a relative resource name against a base resource reference to confirm the final resource
     * exists.
     *
     * @throws FileSystemException if an error occurs during file operations.
     */
    @Test
    public void testResolvePartialResourcePath() throws FileSystemException {
        // Establish a fresh test environment with a properly configured VFS manager
        final DefaultFileSystemManager manager = new DefaultFileSystemManager();
        try {
            // Configure the manager with providers for resource, temp, and local file access
            manager.addProvider("res", new ResourceFileProvider());
            manager.addProvider("file", new DefaultLocalFileProvider());
            manager.addProvider("tmp", new TemporaryFileProvider());
            manager.init();

            // 1. Resolve the base resource location "res:test-data" as a foundation reference point.
            final FileObject baseFolder = manager.resolveFile("res:test-data");
            assertNotNull(baseFolder, "Base folder 'res:test-data' should be resolved.");
            assertTrue(baseFolder.exists(), "Base folder 'res:test-data' must exist on the classpath.");

            // 2. Resolve the relative name "test.zip" against the base reference.
            final FileObject resolvedFile = baseFolder.resolveFile("test.zip");
            assertNotNull(resolvedFile, "Relative path 'test.zip' should be resolvable from base.");

            // 3. Extract the complete resource address and re-resolve to confirm existence.
            final String resolvedUri = resolvedFile.getName().getURI();
            final FileObject finalFile = manager.resolveFile(resolvedUri);
            assertNotNull(finalFile, "Resolving the full URI should return a valid file object.");
            assertTrue(finalFile.exists(), "The final resolved file must exist.");

            // 4. Release resource handles.
            finalFile.close();
            resolvedFile.close();
            baseFolder.close();
        } finally {
            // Teardown: Shut down the file system manager completely.
            manager.close();
        }
    }
}

