import org.apache.commons.vfs2.FileType;
import org.apache.commons.vfs2.VFS;
import org.apache.commons.vfs2.FileName;
import org.apache.commons.vfs2.impl.DefaultFileSystemManager;
import org.apache.commons.vfs2.impl.DefaultFileReplicator;
import org.apache.commons.vfs2.impl.PrivilegedFileReplicator;
import org.apache.commons.vfs2.provider.local.DefaultLocalFileProvider;
import org.apache.commons.vfs2.FilesCache;
import org.junit.jupiter.api.AfterAll;
import org.junit.jupiter.api.BeforeAll;
import org.junit.jupiter.api.Test;

/**
 * Test class for verifying URI resolution behavior with an SMB provider.
 */
public class SmbProviderTest {

    private static DefaultFileSystemManager manager;
    private static File tempDir;
    private static FileObject baseFolder;
    private static FileObject readFolder;
    private static FileObject writeFolder;

    /**
     * Helper to assert that a file is a directory and check its emptiness.
     *
     * @param dirFile The file to check.
     * @throws FileSystemException if an error occurs.
     */
    private static void assertIsDirectory(final FileObject dirFile) throws FileSystemException {
        assertTrue(dirFile.exists(), "Folder should exist: " + dirFile);
        assertEquals(FileType.FOLDER, dirFile.getType(), "Should be a folder: " + dirFile);
        assertFalse(dirFile.getName().isRoot(), "Should not be the root path: " + dirFile);
    }

    /**
     * Helper to assert that a java.io.File is a directory and check its emptiness.
     *
     * @param dir The file to check.
     */
    private static void assertIsDirectoryEmpty(final File dir) {
        assertTrue(dir.exists(), "Temp directory should exist: " + dir);
        assertTrue(dir.isDirectory(), "Temp path should be a directory: " + dir);
        File[] children = dir.listFiles();
        assertTrue(children == null || children.length == 0, "Temp directory should be empty: " + dir);
    }

    @BeforeAll
    public static void setUp() throws Exception {
        // Create a temporary directory for the file replicator
        tempDir = Files.createTempDirectory("vfs-smb-test-").toFile();

        // 1. Obtain a DefaultFileSystemManager.
        manager = new DefaultFileSystemManager();

        // 2. Configure file cache, replicator, and temporary store.
        FilesCache filesCache = manager.getFilesCache();
        DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        PrivilegedFileReplicator privilegedReplicator = new PrivilegedFileReplicator(replicator);
        manager.setFileContentReplicator(privilegedReplicator);
        manager.setTemporaryFileStore(privilegedReplicator);

        // 3. Register the SMB file provider.
        manager.addProvider("smb", new SmbFileProvider());

        // 4. Conditionally add a default local file provider.
        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }

        // Add resource provider for the test
        if (!manager.hasProvider("res")) {
            manager.addProvider("res", new org.apache.commons.vfs2.provider.res.ResourceFileProvider());
        }

        // 5. Initialize the manager.
        manager.init();

        // 6. Resolve base test folders.
        String baseUri = System.getProperty("test.basedir.uri", "ram:///");
        baseFolder = manager.resolveFile(baseUri);

        readFolder = baseFolder.resolveFile("read-tests");
        readFolder.createFolder(); // Ensure it exists for the test.

        writeFolder = baseFolder.resolveFile("write-tests");
        writeFolder.createFolder();

        // 7. Validate the read folder.
        assertIsDirectory(readFolder);
    }

    @AfterAll
    public static void tearDown() throws Exception {
        // Close folders
        if (readFolder != null) {
            readFolder.close();
        }
        if (writeFolder != null) {
            writeFolder.close();
        }
        if (baseFolder != null) {
            baseFolder.close();
        }

        // Trigger garbage collection to clean up soft references.
        System.gc();
        Thread.sleep(500);
        System.gc();
        Thread.sleep(500);

        if (manager != null) {
            manager.freeUnusedResources();
            manager.close();
        }

        // Allow background threads to terminate.
        Thread.sleep(500);

        // Verify the temporary directory is empty or removed.
        if (tempDir != null && tempDir.exists()) {
            assertIsDirectoryEmpty(tempDir);
            Files.delete(tempDir.toPath());
        }

        VFS.close();
    }

    @Test
    public void testResolveFileByUri() throws FileSystemException {
        // Resolve a resource URI to a file name object.
        FileName fileName = manager.resolveURI("res:test-data/test.zip");

        // Assert that the file name represents a file.
        assertNotNull(fileName, "Resolved file name should not be null.");
        assertEquals(FileType.FILE, fileName.getType(), "Resolved name should be of type FILE.");
    }
}

