import org.apache.commons.vfs2.impl.DefaultLocalFileProvider;
import org.apache.commons.vfs2.impl.PrivilegedFileReplicator;
import org.apache.commons.vfs2.provider.smb.SmbFileProvider;

import org.junit.jupiter.api.AfterEach;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

/**
 * Generated test case for VFS providers based on a detailed description.
 */
public class VfsProviderTest {

    private boolean isSetUp;
    private File tempDir;
    private DefaultFileSystemManager manager;
    private FileObject baseFolder;
    private FileObject readFolder;
    private FileObject writeFolder;

    private static final String TEST_URI = "test.uri";
    private static final String READ_TESTS_FOLDER = "read-tests";
    private static final String WRITE_TESTS_FOLDER = "write-tests";

    @BeforeEach
    public void setUp() throws Exception {
        if (isSetUp) {
            return;
        }

        tempDir = getTestDirectory("temp");
        FileUtils.cleanDirectory(tempDir);
        checkEmpty(tempDir, "Temp dir not empty before test");

        manager = new DefaultFileSystemManager();
        manager.setFilesCache(new DefaultFilesCache());

        final DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        manager.setReplicator(new PrivilegedFileReplicator(replicator));
        manager.setTemporaryFileStore(replicator);

        prepare(manager);

        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }

        manager.init();

        System.setProperty(TEST_URI, tempDir.toURI().toString());

        baseFolder = getBaseFolderWithJunction(manager);

        if (baseFolder != null) {
            // Create dummy folders for tests
            readFolder = baseFolder.resolveFile(READ_TESTS_FOLDER);
            readFolder.createFolder();
            writeFolder = baseFolder.resolveFile(WRITE_TESTS_FOLDER);
            writeFolder.createFolder();

            assertTrue(readFolder.exists(), "Folder does not exist: " + readFolder);
            assertNotEquals(FileName.ROOT_PATH, readFolder.getName().getPath());
        }

        isSetUp = true;
    }

    @AfterEach
    public void tearDown() throws Exception {
        if (readFolder != null) {
            readFolder.close();
            readFolder = null;
        }
        if (writeFolder != null) {
            writeFolder.close();
            writeFolder = null;
        }
        if (baseFolder != null) {
            baseFolder.close();
            baseFolder = null;
        }

        System.gc();
        Thread.sleep(1000L);
        System.gc();
        Thread.sleep(1000L);
        System.gc();
        Thread.sleep(1000L);
        System.gc();
        Thread.sleep(1000L);

        if (manager != null) {
            manager.freeUnusedResources();
            manager.close();
            manager = null;
        }

        Thread.sleep(20L);

        checkEmpty(tempDir, "Temp dir not empty after test");

        VFS.close();
    }

    @Test
    public void testResolveFileAsPerDescription() throws FileSystemException {
        final FileName result = getManager().resolveURI("res:/test-data/test.zip");
        assertTrue(result.isFile());
    }

    private void checkEmpty(final File file, final String message) {
        if (file.exists()) {
            assertTrue(file.isDirectory(), message + " (" + file.getAbsolutePath() + ")");
            assertTrue(ArrayUtils.isEmpty(file.list()), message + " (" + file.getAbsolutePath() + ")");
        }
    }

    private void prepare(final DefaultFileSystemManager fsManager) throws FileSystemException {
        fsManager.addProvider("smb", new SmbFileProvider());
    }

    private FileObject getBaseFolder(final FileSystemManager fsManager) throws FileSystemException {
        final String uri = System.getProperty(TEST_URI);
        return fsManager.resolveFile(uri);
    }

    private FileObject getBaseFolderWithJunction(final FileSystemManager fsManager) throws FileSystemException {
        final FileObject realBaseFolder = getBaseFolder(fsManager);
        final FileSystem newFs = realBaseFolder.createVirtualFileSystem("vfs:").getFileSystem();
        final String junctionPoint = "/some/dir";
        newFs.addJunction(junctionPoint, realBaseFolder);
        return newFs.resolveFile(junctionPoint);
    }

    public FileSystemManager getManager() {
        return manager;
    }

    private File getTestDirectory(final String name) throws IOException {
        final File dir = new File("target/test-dir/" + name);
        FileUtils.forceMkdir(dir);
        return dir;
    }
}
